import React from "react";
import { useSelector } from "react-redux";
import AppLayout from "../components/AppLayout";

const Home = () => {
  const { loginFl } = useSelector((state) => state.user);
  const { mainPosts } = useSelector((state) => state.post);
  return (
    <>
      <AppLayout>
        <PostFrom />
        <PostCard />
      </AppLayout>
    </>
  );
};

export default Home;
